  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115007 includes chemical,
  discrete sample, physical and profile data collected from KAIYO-MARU in the North
  Pacific Ocean and Philippine Sea from 1994-01-07 to 1994-02-10 and retrieved during
  cruise WOCE_P02T. These data include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11),
  CHLOROFLUOROCARBON-12 (CFC-12), DELTA CARBON-14, DISSOLVED INORGANIC CARBON, DISSOLVED
  OXYGEN, HYDROSTATIC PRESSURE, NITRATE, PHOSPHATE, Potential temperature (theta),
  SALINITY, SILICATE, WATER TEMPERATURE and pH. The instruments used to collect these
  data include CTD and bottle. These data were collected by Ono Tsuneo of Hokkaido
  National Fisheries Research Institute as part of the WOCE_P02T data set.nnThe World
  Ocean Circulation Experiment (WOCE) was a major component of the World Climate Research
  Program with the overall goal of better understanding the ocean's role in climate
  and climatic changes resulting from both natural and anthropogenic causes. The CO2
  survey took advantage of the sampling opportunities provided by the WOCE Hydrographic
  Program (WHP) cruises during this period between 1990 and 1998. The final collection
  covers approximately 23,000 stations from 94 WOCE cruises.\",\n\t\"owner_org\":
